import React from "react";
import {Link} from "react-router-dom";
import "./Header.css";

function Header() {
  return (
    <div className="header">
       <nav class="navbar navbar-expand-lg navbar-light bg-light border-bottom">
          <div class="container-fluid">
          {/* <Link class="navbar-brand" href="#">
          <img src="https://jwt.io/img/pic_logo.svg" alt="Logo" width="30" height="24" class="d-inline-block align-text-top"/>
           Bootstrap
            </Link> */}
              <div class="collapse navbar-collapse" id="navbarNav">
                  <ul class="navbar-nav ms-auto mt-2 mt-lg-0">
                      <li class="nav-item active"><a class="nav-link" href="#!">Home</a></li>
                      <li class="nav-item"><a class="nav-link" href="#!">Link</a></li>
                      <li class="nav-item dropdown">
                          {/* <a class="nav-link dropdown-toggle" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-haspopup="true" aria-expanded="false">Dropdown</a> */}
                          <div class="dropdown-menu dropdown-menu-end" aria-labelledby="navbarDropdown">
                              <a class="dropdown-item" href="#!">Action</a>
                              <a class="dropdown-item" href="#!">Another action</a>
                              <div class="dropdown-divider"></div>
                              <a class="dropdown-item" href="#!">Something else here</a>
                          </div>
                      </li>
                  </ul>
              </div>
          </div>
        </nav>
    </div>
  );
}
export default Header;
